INSERT INTO `tbl_article_content` VALUES (27,35,'<p style=\"text-align:justify\"><span style=\"font-family:NSimSun\"><span style=\"font-size:22px\">&nbsp;&nbsp;<span style=\"font-family:Comic Sans MS,cursive\">Thymeleaf可以实现视图解析，而且还可以像JSP那样使用方言取值（${data}），故SpringBoot官方推荐Thymeleaf，下面就讲解使用教程。</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:NSimSun\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">1.创建好的SpringBoot工程，引入maven依赖项：</span></span></span></p>\n\n<pre>\n<code class=\"language-xml\">&lt;!-- thymeleaf --&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n            &lt;artifactId&gt;spring-boot-starter-thymeleaf&lt;/artifactId&gt;\n            &lt;version&gt;2.1.7.RELEASE&lt;/version&gt;\n        &lt;/dependency&gt;</code></pre>\n\n<p style=\"text-align:justify\"><span style=\"font-family:NSimSun\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">2.在SpringBoot配置文件：application.properties（或者application.yml）中，对thymeleaf添加如下配置</span></span></span></p>\n\n<pre>\n<code class=\"language-xml\">#-----------------thymeleaf配置--------------\nspring.thymeleaf.cache=false\nspring.mvc.static-path-pattern=/static/**\nspring.thymeleaf.prefix=classpath:/templates/\nspring.thymeleaf.suffix=.html\n</code></pre>\n\n<p style=\"text-align:justify\">cache thymeleaf： 页面缓存是否开启，开发过程中，必须false，否则，修改一个页面，你都要重启项目，费事儿</p>\n\n<p style=\"text-align:justify\">static-path-pattern： 静态资源访问路径 ， thymeleaf默认资源位置就是此处</p>\n\n<p style=\"text-align:justify\">prefix：页面资源前缀路径，默认放在templates目录下</p>\n\n<p style=\"text-align:justify\">suffix：后缀名，默认就是html</p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:NSimSun\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">3.在controller层中，需要返回页面时，可直接使用返回String的形式跳转页面（用法和spring自带的视图解析一致）</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">示例demo如下，需要注意的是，controller层注解一定要用@controller，并且不要添加@Response注解。</span></span></p>\n\n<pre>\n<code class=\"language-java\">public String getAboutPage(Model model){\n        model.addAttribute(\"countArticle\",articleService.countArticle());\n        model.addAttribute(\"countCategory\",categoryInfoService.countCategory());\n        return \"/fore/about\";\n    }</code></pre>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p>&nbsp;&nbsp;</p>','2019-09-20 09:41:50','2019-10-24 11:04:16'),(29,37,'<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">&nbsp; 在使用IDEA的过程中，随着代码修改次数的增加，代码文件里会出现大量无用的包引入，虽然不影响使用，但是看着不舒服。还有就是引入一个新的包时，总需要手动Alt+enter的方式引入。</span></span><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">Auto Import的功能是可以帮助我们自动删除无用的包Import(未被引用)，以及自动Import填充尚未导入的包。完全智能化地帮助我们在开发程序时，省略了导包的操作，大大优化了开发的效率。并且，当你移动某个类改变其路径的时候，这个功能会相应的改变关联的文件中包的路径。</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">下面是Auto Import的开启方法。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"285\" src=\"/images/1569054927940.jpg\" width=\"486\" />\n<figcaption>图1.第一步，点击file</figcaption>\n</figure>\n</div>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"587\" src=\"/images/1569054966494.jpg\" width=\"259\" />\n<figcaption>图2.第二步，点击Settings</figcaption>\n</figure>\n</div>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"519\" src=\"/images/1569054994219.jpg\" width=\"746\" />\n<figcaption>图3.第三步勾选红框内的两个选项，点击Apply后退出</figcaption>\n</figure>\n</div>\n\n<p><span style=\"color:#e74c3c\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">Add unambiguous imports on the fly：快速添加明确的导入。</span></span></span></p>\n\n<p><span style=\"color:#e74c3c\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">Optimize imports on the fly：快速优化导入，优化的意思即自动帮助删除无用的导入。</span></span></span></p>','2019-09-21 16:37:59','2019-10-19 17:14:47'),(30,38,'<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">1.在maven依赖配置文件pom.xml中添加以下依赖：</span></span></p>\n\n<pre>\n<code class=\"language-xml\">&lt;!-- 图形验证码 --&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;com.github.penggle&lt;/groupId&gt;\n            &lt;artifactId&gt;kaptcha&lt;/artifactId&gt;\n            &lt;version&gt;2.3.2&lt;/version&gt;\n        &lt;/dependency&gt;</code></pre>\n\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">2.在SpringBoot 配置文件application.properties中添加以下参数：</span></span></p>\n\n<pre>\n<code class=\"language-xml\">#-----------图形验证码----------------\nkaptcha.border=no\nkaptcha.textproducer.font.color=red\nkaptcha.image.width=135\nkaptcha.textproducer.char.string=ACDEFHKPRSTWX345679\nkaptcha.image.height=50\nkaptcha.textproducer.font.size=43\nkaptcha.noise.color=black\nkaptcha.textproducer.char.length=4\nkaptcha.textproducer.font.names=Arial</code></pre>\n\n<p style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"color:#e74c3c\"><span style=\"font-family:NSimSun\">注：相关属性在第三步内有注释。</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">3.新建一个类，继承WebMvcConfigurer,@Value部分为spring boot配置文件中读取的Kaptcha的相关配置。</span></span></p>\n\n<pre>\n<code class=\"language-java\">@Configuration\npublic class MyWebConfigureAdapter implements WebMvcConfigurer {\n@Value(\"${kaptcha.border}\")\n    private String border;\n\n    @Value(\"${kaptcha.textproducer.font.color}\")\n    private String fcolor;\n\n    @Value(\"${kaptcha.image.width}\")\n    private String width;\n\n    @Value(\"${kaptcha.textproducer.char.string}\")\n    private String cString;\n\n    @Value(\"${kaptcha.image.height}\")\n    private String height;\n\n    @Value(\"${kaptcha.textproducer.font.size}\")\n    private String fsize;\n\n    @Value(\"${kaptcha.noise.color}\")\n    private String nColor;\n\n    @Value(\"${kaptcha.textproducer.char.length}\")\n    private String clength;\n\n    @Value(\"${kaptcha.textproducer.font.names}\")\n    private String fnames;\n@Bean\n    public ServletRegistrationBean&lt;KaptchaServlet&gt;servletServletRegistrationBean()throws ServletException{\n        ServletRegistrationBean&lt;KaptchaServlet&gt; servlet = new ServletRegistrationBean&lt;KaptchaServlet&gt;(new KaptchaServlet(), \"/Kaptcha\");//前端获取验证码图片的访问路径\n        servlet.addInitParameter(\"kaptcha.border\", border);// 无边框\n        servlet.addInitParameter(\"kaptcha.textproducer.font.color\", fcolor); // 字体颜色\n        servlet.addInitParameter(\"kaptcha.image.width\", width);// 图片宽度\n        servlet.addInitParameter(\"kaptcha.textproducer.char.string\", cString);// 使用哪些字符生成验证码\n        servlet.addInitParameter(\"kaptcha.image.height\", height);// 图片高度\n        servlet.addInitParameter(\"kaptcha.textproducer.font.size\", fsize);// 字体大小\n        servlet.addInitParameter(\"kaptcha.noise.color\", nColor);// 干扰线的颜色\n        servlet.addInitParameter(\"kaptcha.textproducer.char.length\", clength);// 字符个数\n        servlet.addInitParameter(\"kaptcha.textproducer.font.names\", fnames);// 字体\n        return servlet;\n    }</code></pre>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">4.html页面，在需要添加验证码的地方添加如下html标签语句：</span></span></p>\n\n<pre>\n<code class=\"language-html\">&lt;input type=\"text\" placeholder=\"验证码\" class=\"form-control\" id=\"verifyAdd\"&gt;\n&lt;img id=\"verifyImgAdd\" alt=\"点击更换\" title=\"点击更换\" onclick=\"changeVerifyCode(this)\" src=\"/Kaptcha\"&gt;</code></pre>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">5.JS函数：changeVerifyCode()的实现如下：</span></span></p>\n\n<pre>\n<code class=\"language-javascript\">function changeVerifyCode(img) {\n            img.src=\"/Kaptcha?\"+Math.floor(Math.random()*100);\n        }</code></pre>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">6.新建一个工具类（如果是Spring工程，建议将这个类放在util包内）</span></span></p>\n\n<pre>\n<code class=\"language-java\">public class CodeUtil {\n    /**\n     * 检查验证码是否和预期相符\n     *\n     * @param request\n     * @return\n     */\n    public static boolean checkVerifyCode(HttpServletRequest request,String verifyCodeActual) {\n        String verifyCodeExpected = (String) request.getSession()\n                .getAttribute(com.google.code.kaptcha.Constants.KAPTCHA_SESSION_KEY);\n        if (verifyCodeActual == null || !verifyCodeActual.equals(verifyCodeExpected)) {\n            return false;\n        }\n        return true;\n    }\n}</code></pre>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">7.为了防止暴力破解验证码，每次提交请求后，无论是否成功，我们都要重新更换验证码图片。这里为了方便，我们可以直接调用img标签的.click()方法，就可以实现请求获取新的验证码了。<span style=\"color:#e74c3c\">注意：result.code是我自定义的一个json返回对象的变量，使用时需要对应的改动！</span></span></span></p>\n\n<pre>\n<code class=\"language-javascript\">success:function (result) {\n                    if(result.code==200){\n                        //提示提交成功\n                    }else if(result.code==199){\n                        //提示提交失败，验证码错误\n                    }\n                    $(\"#verifyImgAdd\").click();//更换验证码\n                }</code></pre>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">8.我们需要在controller内调用这个工具类，来实现对验证码的校验。</span></span></p>\n\n<pre>\n<code class=\"language-java\">if(CodeUtil.checkVerifyCode(request，dto.getVerifyCode)==true){\n //这里填写验证成功后调用的服务\n}else{\n    //这里填写验证失败后的返回值\n  }</code></pre>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">9.使用效果</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"319\" src=\"/images/1569243557250.jpg\" width=\"578\" />\n<figcaption>图一：错误验证码提交提示</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">10.总结：Kaptcha验证码的使用逻辑其实就是配置了一个servlet，当你发起一次该servlet的请求时，它会返回一个图片数据，并且会在request中产生对应的验证码，然后我们需要做的就是在controller处对用户输入的验证码和实际验证码进行比对验证，如果相同，则验证通过，否则不通过，需要注意的是，不管验证码是否验证通过，我们都要重新生成验证码，原因是为了防止暴力破解验证码。</span></span></p>','2019-09-23 17:26:51','2019-10-19 17:14:24'),(31,39,'<p><span style=\"font-family:KaiTi_GB2312\"><span style=\"font-size:22px\">&nbsp; </span></span><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">Mybatis逆向工程就是根据指定数据库内的指定数据表进行&ldquo;逆向&rdquo;导出，生成对应的Pojo类、Dao类以及mapper文件（sql语句映射配置文件）,SpringBoot Maven工程使用操作步骤如下：</span></span></p>\n\n<p><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">1.在pom.xml中添加Mybatis逆向工程的依赖。</span></span></p>\n\n<pre>\n<code class=\"language-xml\">&lt;!--MyBatis逆向工程--&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.mybatis.generator&lt;/groupId&gt;\n            &lt;artifactId&gt;mybatis-generator-core&lt;/artifactId&gt;\n            &lt;version&gt;1.3.6&lt;/version&gt;\n        &lt;/dependency&gt;</code></pre>\n\n<p><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">2</span></span><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">.创建一个工具类OverIsMergeablePulgin.java添加到util包下。</span></span></p>\n\n<pre>\n<code class=\"language-java\">import org.mybatis.generator.api.GeneratedXmlFile;\nimport org.mybatis.generator.api.IntrospectedTable;\nimport org.mybatis.generator.api.PluginAdapter;\n\nimport java.lang.reflect.Field;\nimport java.util.List;\n\n/**\n * 避免MyBatiis重复生成的工具类\n */\npublic class OverIsMergeablePlugin extends PluginAdapter {\n    @Override\n    public boolean validate(List&lt;String&gt; warnings) {\n        return true;\n    }\n\n    @Override\n    public boolean sqlMapGenerated(GeneratedXmlFile sqlMap, IntrospectedTable introspectedTable) {\n        try {\n            Field field = sqlMap.getClass().getDeclaredField(\"isMergeable\");\n            field.setAccessible(true);\n            field.setBoolean(sqlMap, false);\n        } catch (Exception e) {\n            e.printStackTrace();\n        }\n        return true;\n    }\n}</code></pre>\n\n<p><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">3.在resources文件夹根目录下创建一个mybatis逆向工程的配置文件generatorConfig.xml<span style=\"color:#e74c3c\">（注意：需要自行配置相关字段）</span></span></span></p>\n\n<pre>\n<code class=\"language-xml\">&lt;?xml version=\"1.0\" encoding=\"UTF-8\"?&gt;\n&lt;!DOCTYPE generatorConfiguration\n        PUBLIC \"-//mybatis.org//DTD MyBatis Generator Configuration 1.0//EN\"\n        \"http://mybatis.org/dtd/mybatis-generator-config_1_0.dtd\"&gt;\n&lt;generatorConfiguration&gt;\n\n    &lt;context id=\"DB2Tables\" targetRuntime=\"MyBatis3\"&gt;\n        &lt;!--避免生成重复代码的插件--&gt;\n        &lt;plugin type=\"第二步工具类位置\"/&gt;\n\n        &lt;!--是否在代码中显示注释--&gt;\n        &lt;commentGenerator&gt;\n            &lt;property name=\"suppressDate\" value=\"true\"/&gt;\n            &lt;property name=\"suppressAllComments\" value=\"true\"/&gt;\n        &lt;/commentGenerator&gt;\n\n        &lt;!--数据库链接地址账号密码--&gt;\n        &lt;jdbcConnection driverClass=\"com.mysql.jdbc.Driver\"\n                        connectionURL=\"jdbc:mysql://127.0.0.1:3306/数据库名称?characterEncoding=UTF-8\" userId=\"用户名\"\n                        password=\"密码\"&gt;\n        &lt;/jdbcConnection&gt;\n\n        &lt;!--生成pojo类存放位置--&gt;\n        &lt;javaModelGenerator targetPackage=\"pojo类包名称\" targetProject=\"src/main/java\"&gt;\n            &lt;property name=\"enableSubPackages\" value=\"true\"/&gt;\n            &lt;property name=\"trimStrings\" value=\"true\"/&gt;\n        &lt;/javaModelGenerator&gt;\n        &lt;!--生成xml映射文件存放位置--&gt;\n        &lt;sqlMapGenerator targetPackage=\"mapper\" targetProject=\"src/main/resources\"&gt;\n            &lt;property name=\"enableSubPackages\" value=\"true\"/&gt;\n        &lt;/sqlMapGenerator&gt;\n        &lt;!--生成mapper类存放位置--&gt;\n        &lt;javaClientGenerator type=\"XMLMAPPER\" targetPackage=\"com.zjg.blog.dao\" targetProject=\"src/main/java\"&gt;\n            &lt;property name=\"enableSubPackages\" value=\"true\"/&gt;\n        &lt;/javaClientGenerator&gt;\n\n        &lt;!--生成对应表及类名--&gt;\n        &lt;table tableName=\"目标表\" domainObjectName=\"生成pojo类名\" enableCountByExample=\"false\"\n               enableUpdateByExample=\"true\" enableDeleteByExample=\"true\" enableSelectByExample=\"true\"\n               selectByExampleQueryId=\"false\"&gt;\n            &lt;property name=\"useActualColumnNames\" value=\"false\"/&gt;\n            &lt;generatedKey column=\"id\" sqlStatement=\"JDBC\"/&gt;\n            &lt;columnRenamingRule searchString=\"is_\" replaceString=\"\"/&gt;\n        &lt;/table&gt;\n    &lt;/context&gt;\n&lt;/generatorConfiguration&gt;</code></pre>\n\n<p><span style=\"font-size:16px\">相关属性介绍：</span></p>\n\n<p><span style=\"font-size:16px\">tableName:要生成的表名</span></p>\n\n<p><span style=\"font-size:16px\">example：开启后，就会生成pojo对应的example类，可以实现复杂操作（where，orderby等sql操作）而不需要修改mapper配置文件</span></p>\n\n<p><span style=\"font-size:16px\">Example用法：1.创建一个example对象（每个实体都会有一个对应的example对象）2.调用example对象的criteria构造方法3.调用criteria的方法（例：critera.andUsernameIsEqualTo(&quot;test&quot;)）4.使用mapper对象的子方法，传入参数为example对象（例：usermapper.selectByExample(exmaple)）<span style=\"color:#e74c3c\">注：此处返回对象为一个list，因为非主键查找会产生多个结果，故返回对象为一个list</span></span></p>\n\n<p><span style=\"font-size:16px\">useActualColumnNames：false 就会开启字段驼峰命名法映射，true则会直接使用数据库里的字段名（不推荐）。</span></p>\n\n<p><span style=\"font-size:16px\">genratedKey:重要，影响插入操作，是否使用自增键</span></p>\n\n<p><span style=\"font-size:16px\">columnRenameingRule：自定义字段生成名，searchString是正则表达式，replaceString是想要替换成的变量名称，根据阿里命名规约，一定要将is_xx字段映射成xx变量，原因是为了避免框架对isXXX变量getter和setter的异常生成，参考《阿里Java开发手册》。</span></p>\n\n<p><span style=\"color:#e74c3c\"><span style=\"font-size:16px\"><span style=\"font-family:SimSun\">注意：table 配置中，需要注意property、generatedKey以及columnRenamingRule的顺序，否则会报错。</span></span></span></p>\n\n<p><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">4.创建一个MybatisGenerator.java,建议放在一个单独的包名下（generator包）</span></span></p>\n\n<pre>\n<code class=\"language-java\">import org.mybatis.generator.api.MyBatisGenerator;\nimport org.mybatis.generator.config.Configuration;\nimport org.mybatis.generator.config.xml.ConfigurationParser;\nimport org.mybatis.generator.internal.DefaultShellCallback;\n\nimport java.io.InputStream;\nimport java.text.SimpleDateFormat;\nimport java.util.ArrayList;\nimport java.util.Date;\nimport java.util.List;\n\npublic class MybatisGenerator {\n\n    public static void main(String[] args) throws Exception {\n        String today = \"2019-09-24\";\n\n        SimpleDateFormat sdf = new SimpleDateFormat(\"yyyy-MM-dd\");\n        Date now = sdf.parse(today);\n        Date d = new Date();\n\n        if (d.getTime() &gt; now.getTime() + 1000 * 60 * 60 * 24) {\n            System.err.println(\"——————未成成功运行——————\");\n            System.err.println(\"——————未成成功运行——————\");\n            System.err.println(\"本程序具有破坏作用，应该只运行一次，如果必须要再运行，需要修改today变量为今天，如:\" + sdf.format(new Date()));\n            return;\n        }\n\n        if (false)\n            return;\n        List&lt;String&gt; warnings = new ArrayList&lt;String&gt;();\n        boolean overwrite = true;\n        InputStream is = MybatisGenerator.class.getClassLoader().getResource(\"generatorConfig.xml\").openStream();\n        ConfigurationParser cp = new ConfigurationParser(warnings);\n        Configuration config = cp.parseConfiguration(is);\n        is.close();\n        DefaultShellCallback callback = new DefaultShellCallback(overwrite);\n        MyBatisGenerator myBatisGenerator = new MyBatisGenerator(config, callback, warnings);\n        myBatisGenerator.generate(null);\n\n        System.out.println(\"生成代码成功，只能执行一次，以后执行会覆盖掉mapper,pojo,xml 等文件上做的修改\");\n    }\n}</code></pre>\n\n<p><span style=\"color:#e74c3c\"><span style=\"font-size:16px\">注意：由于具有破坏作用，所以需要配置时间，否则无法运行！</span></span></p>\n\n<p><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">5.运行第四步main函数的结果</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"218\" src=\"/images/1569319053796.jpg\" width=\"1016\" />\n<figcaption>图1.运行结果</figcaption>\n</figure>\n</div>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-family:SimSun\"><span style=\"font-size:22px\">6.总结：mybatis逆向工程时，大致的思路了解后，其实很简单，example那一段刚开始看时比较难理解，但是example是一个很精巧的设计，它可以实现更加完善的高级操作，而不需要改动pojo类对应的mapper配置文件（添加新语句，由于特殊的操作需要单独写一个语句，时间久了，会导致mapper配置文件的冗余，降低可维护性，同时也会降低开发效率）。除此以外需要注意的是，字段转换时一定要把 useActualColumnNames 的属性设置为 false，建议库中字段使用下划线，程序部分使用驼峰法，这是一个编程规约，建议养成好习惯。还需要注意的是，对于is_xxx字段，在生成成员变量时，一定要配置 columnRenamingRule 属性把is_xxx字段转换成xxx变量，此做法是为了保证框架注入的稳定性，is方法冲突，这也是个编程规约，一定要养成习惯。</span></span></p>','2019-09-24 17:40:22','2019-10-19 17:14:09'),(33,41,'<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">在学习C/C++之后学习Java会遇到以下问题：有些时候传递值是拷贝传递，有些时候传递是引用传递，对象数组访问会报空异常等等。</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#e74c3c\">问题1：</span>Java有哪些数据类型？</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;首先，对于Java中的数据类型，官方给出了以下划分：</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;1.primitive 变量（基本类型）</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:16px\">该类型是最底层不可分割的数据类型，目前Java共有8种此类：boolean,char,byte,short,int,long,float,double<span style=\"color:#e74c3c\">（注意：不包含String）</span></span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;2.对象引用变量</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;</span><span style=\"font-size:16px\"> &nbsp;&nbsp;该类型类似于指向对象的指针，但与C++里指针不同的地方在于：对象引用变量的引用由虚拟机完成，我们只需要知道对象引用变量指向哪个对象，而不用担心指针越界或者&ldquo;野指针的问题&rdquo;</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#e74c3c\">问题2:</span>如何理解对象引用变量？和基本类型有什么区别？</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 首先，我们需要弄清楚对象引用变量究竟扮演一个怎么样的角色：</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 引用变量其实就像是一个遥控器，我们声明一个引用变量，就是相当于拿了一个遥控器，值得注意的是，这个&ldquo;遥控器&rdquo;也是要分类型的，空调遥控器肯定是不能用来控制电视的，反之同理</span></span></p>\n\n<pre>\n<code class=\"language-java\">public static void main(String args[]){\n     User a;\n}</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">举个例子，上面的代码表示声明了一个User 型的对象引用变量a，a只能用于&ldquo;遥控&rdquo;User</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 光有遥控器是远远不够的，我们还需要给它分配个被控制的东西</span></span></p>\n\n<pre>\n<code class=\"language-java\">public static void main(String args[]){\n     User a=new User();\n}</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">举个例子，上面额代码表示在对象堆中创建了一个新对象，并让对象引用变量</span></span><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">a对其实施控制,值得注意的是，一旦对象脱离了引用变量，就会被虚拟机回收，所以不需要担心内存管理问题。（c语言需要malloc和free函数手动实现内存的分配和销毁）</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">当然，上面的例子也告诉我们Java中对象是如何使用的：先声明引用变量，然后在对象堆中创建对象，并将引用变量指向对象，这样，我们就可以通过引用变量来控制对象（Java中没有对象变量这种说法）。</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">而基本类型数据的使用，我们直接赋值即可，不需要为其分配对象</span></span></p>\n\n<pre>\n<code class=\"language-java\">int a=10;\n\nUser b=new User(\"张三\",\"123456\");</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">举个例子,基本类型数据和引用类型的区别，前者不需要手动分配对象，后者却需要。</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#e74c3c\">问题3：</span>这两种类型的数据在传递时是如何传递的？</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">Java数据类型传递只有两种：一种是拷贝传递，一种是引用传递，前者在传递后会复制一份进行操作，不会影响到原来的数据；后者传递时会直接赋值一个引用变量，也就是复制了一个新的遥控器，传递之后，就会有两个&ldquo;遥控器&rdquo;控制同一个对象，如果想要实现单独控制，那只能创建一个对象复制传过来的对象，并把新的&ldquo;遥控器&rdquo;指向新的对象。</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#e74c3c\">问题4：</span>这两种类型数据的数组有什么区别？</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">没有区别，创建数组，就是连续创建多个此类型的数据，但需要注意的是，我们创建对象数组时，需要创建对象引用数组，然后逐个分配对象。</span></span></p>\n\n<pre>\n<code>int []a =new int[10];\n</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">举个例子，上面的例子是基本（int）类型的数组创建语句，这条语句在执行后，我们会得到一个初始值为0的10个int类型数据的数组（<span style=\"color:#e74c3c\">Java数组是有默认值的，主数据类型都是0，引用类型都是null</span>）</span></span></p>\n\n<pre>\n<code class=\"language-java\">User[] a=new User[10];</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">举个例子,这条语句执行后，我们会得到10个引用类型的数据，相当于得到了10个&ldquo;遥控器&rdquo;，而不是得到了10个对象！！如果直接访问，会空异常，我们还需要对引用逐个分配对象，这样才能通过下标的方式访问对象</span></span></p>\n\n<pre>\n<code class=\"language-java\">for（int i=0;i&lt;10;i++）{\n   a[i]=new User();\n}</code></pre>\n\n<p><span style=\"color:#e74c3c\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">总结：</span></span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">Java和C语言一样，都存在拷贝传递和引用传递，<span style=\"color:#e74c3c\">不过Java的拷贝传递只存在于基本类型的数据，引用传递只存在于对象数据，</span>而且Java 的引用类型完全封死，只能用来控制其对应的对象，这和C语言有着很大的区别。</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">必须要弄清楚数据类型的基本规则和原理，否则在开发过程中会遇到莫名其妙的空值异常和赋值异常。</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"color:#e74c3c\"><span style=\"font-family:Comic Sans MS,cursive\">补充：</span></span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">对于Java主数据类型默认值的问题，需要补充的是，基本类型的数组在new时会分配默认值为0。</span></span></p>\n\n<pre>\n<code class=\"language-java\">public static void main(String args[]){\n        int [] a=new int[10];\n        for(int i:a){\n            System.out.print(i);\n        }\n\n    }</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">运行结果为：</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"125\" src=\"/images/1570772257747.jpg\" width=\"555\" />\n<figcaption>图1.int型数组默认值打印</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">而非数组的基本类型变量是没有默认值的，编译无法通过（如下）。</span></span></p>\n\n<pre>\n<code class=\"language-java\"> public static void main(String args[]){\n        int i;\n        System.out.println(i);\n\n    }</code></pre>\n\n<p>&nbsp;</p>','2019-10-11 10:28:58','2020-02-13 16:47:47'),(35,43,'<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;</span><span style=\"font-family:Comic Sans MS,cursive\">由于性能需要，迫使需要对展示数据记录，也就是数据库&ldquo;查&rdquo;的操作进行分页操作，mysql里关键字limit可以实现这一点，但是过于复杂，使用PageHelper可以很好的实现分页，而不需要对dao层mapper进行修改。对于分页操作，你只需要在你需要分页的sql语句执行部分之前添加下面一句即可实现查找的分页。</span></span></p>\n\n<pre>\n<code class=\"language-java\">PageHelper.startPage(pageNum,pageSize);</code></pre>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;对于查找到的数据List是PageHelper分页过的数据，我们需要将其封装为PageInfo对象，返回到前台，封装方法也很简单，如下。</span></span></p>\n\n<pre>\n<code class=\"language-java\">PageInfo&lt;ArticleInfo&gt; daoPageInfo=new PageInfo&lt;&gt;(daoList);</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">&nbsp;&nbsp;</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">有木有觉得很简单？但是一般我们网页展示的数据可能和数据库存的不一样（数据库冗余的要求），额外添加字段是很常见的事，即将DAO数据库对象二次封装成DTO数据传输层对象，然后再传给前端，如下代码。</span></span></p>\n\n<pre>\n<code class=\"language-java\">for(ArticleInfo item:daoList){\n            ArticlePreviewDto dto=new ArticlePreviewDto();\n            dto.setPrivated(item.getPrivated());\n            dtoList.add(dto);\n        }\n        PageInfo&lt;ArticlePreviewDto&gt; dtoPageInfo=new PageInfo&lt;&gt;(dtoList);</code></pre>\n\n<p>&nbsp; <span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">如果不是很了解PageInfol类的话，一定会觉得上面语句执行的没毛病，<span style=\"color:#e74c3c\">但是，这种操作会导致分页数据的丢失，例如pageInfo内的total，pageNum等数据，这就是造成分页不成功的主要原因。</span>这时候，你就需要看一下PageInfo这个类的构造函数。</span></span></p>\n\n<pre>\n<code class=\"language-java\"> public PageInfo(List&lt;T&gt; list) {\n        this(list, 8);\n    }\n\n    public PageInfo(List&lt;T&gt; list, int navigatePages) {\n        this.isFirstPage = false;\n        this.isLastPage = false;\n        this.hasPreviousPage = false;\n        this.hasNextPage = false;\n        if (list instanceof Page) {\n            Page page = (Page)list;\n            this.pageNum = page.getPageNum();\n            this.pageSize = page.getPageSize();\n            this.pages = page.getPages();\n            this.list = page;\n            this.size = page.size();\n            this.total = page.getTotal();\n            if (this.size == 0) {\n                this.startRow = 0;\n                this.endRow = 0;\n            } else {\n                this.startRow = page.getStartRow() + 1;\n                this.endRow = this.startRow - 1 + this.size;\n            }\n        } else if (list instanceof Collection) {\n            this.pageNum = 1;\n            this.pageSize = list.size();\n            this.pages = this.pageSize &gt; 0 ? 1 : 0;\n            this.list = list;\n            this.size = list.size();\n            this.total = (long)list.size();\n            this.startRow = 0;\n            this.endRow = list.size() &gt; 0 ? list.size() - 1 : 0;\n        }\n\n        if (list instanceof Collection) {\n            this.navigatePages = navigatePages;\n            this.calcNavigatepageNums();\n            this.calcPage();\n            this.judgePageBoudary();\n        }\n\n    }</code></pre>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;细心的你一定会发现，当生成组装dtoList的PageInfo对象时，实际上已经调用了默认构造函数，默认构造函数会把total之类初始化为0，<span style=\"color:#e74c3c\">这是因为组装的dtoList不再是PageHelper所监听的那个daoList了，正确做法应当是直接创建daoList对应的pageInfo,然后将其复制到dtoList的pageInfo，</span>代码如下：</span></span></p>\n\n<pre>\n<code class=\"language-java\">List&lt;ArticleInfo&gt;daoList=infoMapper.selectByExample(example);\n        PageInfo&lt;ArticleInfo&gt; daoPageInfo=new PageInfo&lt;&gt;(daoList);\n        List&lt;ArticlePreviewDto&gt;dtoList=assembleDtoList(daoList);\n        PageInfo&lt;ArticlePreviewDto&gt; dtoPageInfo=new PageInfo&lt;&gt;(dtoList);\n        PageInfoUtil.copyPageInfo(daoPageInfo,dtoPageInfo);//复制pageInfo属性的函数</code></pre>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">然后，你就可以得到正确的分页效果了。</span></span></p>','2019-10-15 21:35:54','2019-11-14 20:28:59'),(36,44,'<p>&nbsp;&nbsp;<span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">Thymeleaf最基本的取值操作，网络上很多教程，我就不予以重复介绍了，本文主要介绍Thymeleaf的高级操作：判别和循环</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">1.判别</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 判别就是对布尔值进行判别，用于决定是否渲染模块，可能需要和迭代搭配使用，可以实现当list大小为0时，输出默认模块。其用法共有三种，下面分开讲一下。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;if</span></span></p>\n\n<pre>\n<code class=\"language-html\">&lt;div th:if=\"${boolean}\"&gt;\n  &lt;span&gt;输出内容&lt;/span&gt;\n&lt;/div&gt;</code></pre>\n\n<p><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;&nbsp;&nbsp;需要注意的是，if会判别双引号内的值，如果为true，则输出模块，里面的值可以使后台传来的boolean值，也可以是Thymeleaf表达式的值</span></span></p>\n\n<pre>\n<code class=\"language-html\">&lt;div th:if=\"${name} eq \'Tom\'\"&gt;\n  &lt;span&gt;输出内容&lt;/span&gt;\n&lt;/div&gt;</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:16px\">Thymeleaf表达式不限于eq，只要是能传回boolean值即可。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">unless</span></span></p>\n\n<pre>\n<code class=\"language-html\">&lt;div th:unless=\"${boolean}\"&gt;\n  &lt;span&gt;输出内容&lt;/span&gt;\n&lt;/div&gt;</code></pre>\n\n<p><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-family:&quot;Comic Sans MS&quot;,cursive; font-size:16px\">unless的实现效果是和if相反的，但是用法一致，就不多阐述了。</span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">switch</span></span></p>\n\n<pre>\n<code class=\"language-html\">&lt;div th:switch=\"${name}\"&gt;\n  &lt;p th:case=\"\'Tom\'\"&gt;Tom&lt;/p&gt;\n  &lt;p th:case=\"*\"&gt;default&lt;/p&gt;\n&lt;/div&gt;</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;&nbsp;&nbsp;switch语句实现了多重情况的判别，每一种情况都需要使用case修饰，<span style=\"color:#e74c3c\">注意默认是case+内容为*，而不是default</span></span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">2.循环</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; </span></span><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">Thymeleaf支持对List类的迭代操作，此操作的主要目的就是实现多个模块的渲染，只需要写出其中一个渲染模块模板，Thymeleaf就可以按照模板，把List的数据迭代渲染出来，用法如下：</span></span></p>\n\n<pre>\n<code class=\"language-html\">&lt;div th:each=\"item:${list}\"&gt;\n  &lt;span th:text=\"${item.name}\"&gt;&lt;/span&gt;\n&lt;/div&gt;</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;如果我们需要取出渲染模块的索引（迭代索引，好比一个循环中的自增变量）、索引奇偶判别以及迭代总次数等数据，则可以取出渲染迭代器，语法如下</span></span></p>\n\n<pre>\n<code class=\"language-html\">&lt;div th:each=\"item,state:${list}\"&gt;\n  &lt;span th:text=\"${item.name}+${state.index}\"&gt;&lt;/span&gt;\n&lt;/div&gt;</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 需要在我们命名的迭代变量后添加一个迭代器名称，示例代码中的state就是list对应的迭代器，可以取出迭代器的属性，可获得的属性如下</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">index ：当前节点的索引，从0开始</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">size ： 迭代节点总数</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">even/odd：当前是偶数/奇数行，boolean值</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:16px\"><span style=\"font-family:Comic Sans MS,cursive\">first/last：当前是每天/最后一个元素</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 以上迭代器属性可能需要搭配Thymeleaf判别实现高级渲染。</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">3.总结</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 以上就是Thymeleaf判别和迭代的用法，实际渲染中，可能会出现迭代和判别混合使用的情况，逻辑关系会变得复杂，但只要构思清楚标签的层次关系以及各类修饰符的基本含义，就不会复杂了，例如if、unless，决定<span style=\"color:#e74c3c\">是否打印整个标签</span>，可用于单位模块上；each用于单位标签上，决定<span style=\"color:#e74c3c\">迭代整个标签，</span>迭代器可以用来进行筛选，既可以用在标签的子标签上，也可以用在母标签上<span style=\"color:#e74c3c\">；switch则是用在母标签上，判别需要打印哪一个子标签；case则用在子标签上，用于标识自己。</span></span></span></p>','2019-10-17 20:53:43','2019-11-14 20:32:18'),(49,57,'<p>&nbsp; <span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">本篇日志记录JQuery的一些不常用的方法，用以备忘，并且不定时更新此篇日志。点击<u><a href=\"https://www.w3school.com.cn/jquery/index.asp\" target=\"_blank\">此处</a></u>访问JQuery教程</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">1.回到页面顶部：</span></span></p>\n\n<pre>\n<code class=\"language-javascript\">$(\"html,body\").animate({scrollTop:0},200);</code></pre>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">200表示CSS属性变化的过渡时间，单位为ms,{}内为css属性，scrollTop:返回顶部的距离，多个属性需要用逗号隔开（非中文的逗号）JQuery animate用法详情查询文档。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">2.悬停事件</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">悬停有两种，hover和mouseover,前者在鼠标进入、离开标签时会各执行一次，而mouseover只在鼠标进入标签时执行一次。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\">3.选择某一控件的子控件</span></span></p>\n\n<pre>\n<code class=\"language-javascript\">$(\'#table &gt; tbody\') 或$(\'#table \').find(\' tbody\')</code></pre>\n\n<p style=\"margin-left:40px\">&nbsp;</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">4.表格选择某一列、某一行数据</span></span></p>','2019-10-28 15:02:20','2020-04-02 13:27:53'),(50,58,'<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 一、SpringMVC实现静态资源映射方法如下</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">在Spring配置文件中添加如下配置：</span></span></p>\n\n<pre>\n<code class=\"language-xml\">&lt;mvc:resources mapping=\"views/**\" location=\"file:/D:/views/\"/&gt;</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;&nbsp;&nbsp;需要注意的是一定要加上<span style=\"color:#e74c3c\">file:/,</span>否则无法正确映射</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 二、SpringBoot实现静态资源映射方法如下</span></span></p>\n\n<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; </span></span><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">写一个类（建议创建一个config包）重写方法</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; SpringBoot不同大版本配置方式不一样，需要注意下</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;1.SpringBoot 1.x</span></span></p>\n\n<pre>\n<code class=\"language-java\">public class WebConfigureAdapter extends WebMvcConfigurerAdapter {\n    @Override\n    public void addResourceHandlers(ResourceHandlerRegistry registry){\n        registry.addResourceHandler(\"views/**\").addResourceLocations(\"file:/D:views/\");\n    }\n}</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp; 2.SpringBoot 2.x</span></span></p>\n\n<pre>\n<code class=\"language-java\">@Configuration\npublic class MyWebConfigureAdapter implements WebMvcConfigurer {\n@Override\n    public void addResourceHandlers(ResourceHandlerRegistry registry) {\n        registry.addResourceHandler(\"views/**\")\n                .addResourceLocations(\"file:/D:/views/);\n    }\n}</code></pre>\n\n<p>&nbsp;&nbsp;&nbsp; <span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">同上，也需要加上<span style=\"color:#e74c3c\">file:/,</span>否则无法正确映射,当然SpringBoot 2.x也可以基层1.x的类，不过官方不推荐，最好改成最新版本的，Idea也会提示更换继承较新的WebMvcConfigurer类。</span></span><br />\n<span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;</span></span></p>','2019-10-29 20:48:20','2019-11-05 20:24:10'),(51,59,'<p>&nbsp; <span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">推荐一个超级好用的Java基础工具类&mdash;&mdash;Hutool，里面整合了大量的工具，同时由于其统一性，不会产生兼容问题，规范统一，再也不需要google一大堆乱七八糟的方法以及分辨方式，刚开始用就感受到BeanUtil的强大，直接拷贝属性，不需要对POJO对象一个一个set属性了。开发JavaWeb用这个工具不要太舒服！强烈推荐使用。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"509\" src=\"/images/1572957198322.jpg\" width=\"625\" />\n<figcaption>图1 hutool包含的模块</figcaption>\n</figure>\n</div>\n\n<p style=\"text-align:center\"><a href=\"https://www.hutool.cn/\"><u><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">点击此处访问</span></span></u></a></p>','2019-11-05 20:32:29','2019-11-14 20:38:05'),(52,60,'<p><span style=\"font-size:22px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;Java 1.8环境变量配置如下：</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">&nbsp;&nbsp;</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">1.</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">&nbsp;</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">打开环境变量设置，点击新建，注意是系统变量不是用户变量。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"341\" src=\"/images/1573903314234.jpg\" width=\"353\" />\n<figcaption>图1 环境变量设置页面</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">2.新建一个系统变量，变量名为 <span style=\"color:#e74c3c\">JAVA_HOME&nbsp;</span>,变量值为你jdk安装的目录根目录，例如：</span></span><span style=\"color:#e74c3c\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">C:\\Program Files\\Java\\jdk1.8.0_121</span></span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"145\" src=\"/images/1573904091275.jpg\" width=\"562\" />\n<figcaption>图2 配置系统变量JAVA_HOME</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">3.再创建一个系统变量，变量名为 <span style=\"color:#e74c3c\">classpath&nbsp;</span>,变量值为&nbsp;<span style=\"color:#e74c3c\">%JAVA_HOME%\\lib\\dt.jar;%JAVA_HOME%\\lib\\tools.jar&nbsp;</span></span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"148\" src=\"/images/1573904126979.jpg\" width=\"572\" />\n<figcaption>图3 配置系统变量 classpath</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">4.回到刚才的环境变量设置，在系统变量内查找 Path，点击编辑，然后点击新建一个环境变量，输入<span style=\"color:#e74c3c\"> %JAVA_HOME%\\bin</span></span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"446\" src=\"/images/1573904164660.jpg\" width=\"455\" />\n<figcaption>图4 添加环境变量</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;5.创建完成后，win +r 输入 cmd 运行后，输入java 回车，检测Java环境变量是否配置成功。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"331\" src=\"/images/1573904400363.jpg\" width=\"633\" />\n<figcaption>图5 检查环境变量是否配置成功</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">&nbsp;&nbsp;</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">需要注意的是classpath，java_home ，环境变量一个也不能少。</span></span></p>','2019-11-16 19:41:10','2020-02-13 16:47:26'),(53,61,'<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:22px\">windows10 安装Mysql 5.7.27时，发现mysql官网只有32位版本有.msi的安装包，而64位版本只能下载zip包，自行配置，配置方式如下：</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">1.在mysql官网下载5.7.27 64 zip包，<a href=\"https://downloads.mysql.com/archives/community/\"><span style=\"color:#3498db\"><u>点击此处</u></span></a>访问，下载完毕后，解压到不包含任意中文的路径下（<span style=\"color:#e74c3c\">非常重要，如果在中文路径下，会安装失败</span>）</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">2.解压完成后，复制路径，创建系统变量&nbsp;</span></span><span style=\"color:#e74c3c\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">MYSQL_HOME&nbsp;</span></span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">值为所复制的路径</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"137\" src=\"/images/1574066318397.jpg\" width=\"530\" />\n<figcaption>图1 创建系统变量</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">3.点击系统变量path，创建一个新的环境变量&nbsp;<span style=\"color:#e74c3c\">%MYSQL_HOME%\\bin&nbsp;</span>，保存退出即可。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"359\" src=\"/images/1574066363756.jpg\" width=\"366\" />\n<figcaption>图2 添加环境变量</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">4.配置完系统变量以及环境变量后，打开zip包解压的目录下，新建一个 my.ini 文件，内容如下（basedir使用Mysql所在路径,datadir 建议使用basedir+\\data，<span style=\"color:#e74c3c\">data目文件夹一定不要自己创建，下面的操作会自动创建data文件夹，自行创建data文件夹回导致安装失败！</span>）：</span></span></p>\n\n<pre>\n<code class=\"language-xml\">[mysqld]\n#端口号\nport = 3306\nbasedir=D:\\mysql-5.7.27-winx64\ndatadir=D:\\mysql-5.7.27-winx64\\data\n#最大连接数\nmax_connections=200\n#编码\ncharacter-set-server=utf8\n\ndefault-storage-engine=INNODB\n\nsql_mode=NO_ENGINE_SUBSTITUTION,STRICT_TRANS_TABLES\n\n[mysql]\n#编码\ndefault-character-set=utf8 </code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">5.创建完成后，田（windows）+s 打开windows搜索，输入cmd，右键以管理员身份运行，然后打开到路径 <span style=\"color:#e74c3c\">C:\\mysql-5.7.27-winx64\\bin</span>。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"172\" src=\"/images/1574066398986.jpg\" width=\"205\" />\n<figcaption>图3 启动命令行</figcaption>\n</figure>\n</div>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"325\" src=\"/images/1574066472850.jpg\" width=\"622\" />\n<figcaption>图4 访问数据库bin目录</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">6.输入以下指令，安装mysql（<span style=\"color:#e74c3c\">如果提示缺少msvcr120.dll msvcp120.dll的问题，请下载安装</span></span><span style=\"font-size:16px\"><span style=\"color:#e74c3c\">Visual C++ Redistributable Packages for Visual Studio 2013 </span><a href=\"https://www.microsoft.com/zh-cn/download/confirmation.aspx?id=40784\"><span style=\"color:#e74c3c\">点击此处</span></a><span style=\"color:#e74c3c\">下载 x64版本</span></span><span style=\"font-size:20px\">）</span></span></p>\n\n<pre>\n<code class=\"language-xml\">mysqld -install</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">7.输入以下指令，初始化mysql，耗时因配置而异，执行结束后，cmd会打印出初始密码，<span style=\"color:#e74c3c\">记下来，后面进入mysql需要使用</span>。</span></span></p>\n\n<pre>\n<code class=\"language-xml\">mysqld --initialize --console</code></pre>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"147\" src=\"/images/1580475450083.jpg\" width=\"749\" />\n<figcaption>图5 初始化后获取原始root密码</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">8.输入以下指令，启动mysql</span></span></p>\n\n<pre>\n<code class=\"language-xml\">net start mysql</code></pre>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"67\" src=\"/images/1574066564249.jpg\" width=\"325\" />\n<figcaption>图6 启动mysql服务</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">9.启动完成后，输入以下指令，密码根据第7步所得</span></span></p>\n\n<pre>\n<code class=\"language-xml\">mysql -u root -p</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">10.修改root密码，mysql 5.7.27 x64到此安装结束</span></span></p>\n\n<pre>\n<code class=\"language-xml\">alter user \'root\'@\'localhost\' identified by \'youpassword\'; \n flush privileges;</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">11.如果需要开放远程登录操作，输入以下代码。</span></span></p>\n\n<pre>\n<code class=\"language-xml\">GRANT ALL PRIVILEGES ON *.* TO \'root\'@\'%\' IDENTIFIED BY \'123456\';\nflush privileges; </code></pre>\n\n<p>&nbsp;</p>','2019-11-18 16:25:20','2020-01-31 21:05:20'),(54,62,'<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">SpringBootWeb项目添加SSL证书方法如下：</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">1.<a href=\"https://console.cloud.tencent.com/ssl\">点击此处</a>访问腾讯云获取SSL证书，免费申请个人证书，私钥密码不需要填写。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"333\" src=\"/images/1580639166616.jpg\" width=\"645\" />\n<figcaption>图1 腾讯云申请免费SSL证书</figcaption>\n</figure>\n</div>\n\n<p>&nbsp;</p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"497\" src=\"/images/1580639278524.jpg\" width=\"508\" />\n<figcaption>图2 填入网站信息</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">2.域名身份需要验证（以证明这个域名是属于你的），前往所绑定域名的服务商修改域名的解析，我这里是阿里云的域名，操作大概是一样的。（图3内的_dnsauth以及记录值是图二进行域名身份验证所获取的）</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"264\" src=\"/images/1580639419258.jpg\" width=\"736\" />\n<figcaption>图3 添加解析记录进行域名身份验证</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">3.域名身份验证完成后（dns解析可能有延迟），下载刚才所申请成功的证书，获取一个名称为对应域名的压缩包并且将其解压完成。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"212\" src=\"/images/1580639713710.jpg\" width=\"616\" />\n<figcaption>图5 证书列表</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">4.由于Springboot内部继承了Tomcat容器，故只需要Tomcat的两个文件。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"160\" src=\"/images/1580639800945.jpg\" width=\"435\" />\n<figcaption>图6 所需的证书文件</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">5.打开SpringBoot项目，在Springboot配置文件中添加以下设置参数,并且将图6中jks的文件复制到项目Resource的目录下，与Application.properties或者.yml同级目录，ssl证书密码是图6中keystorePass.txt文件中的字符串。</span></span></p>\n\n<pre>\n<code class=\"language-xml\">#--------端口设置------------------\nserver.port=443\n#----------ssl配置---------\n#ssl证书路径\nserver.ssl.key-store=classpath:www.zhoujianguo.ltd.jks\n#ssl证书密码\nserver.ssl.key-store-password=\n#证书类型\nserver.ssl.key-store-type=jks</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">6.在Springboot主函数所在类即XXXXApplication.java添加以下属性，目的是实现http80端口自动跳转至443端口实现https访问</span></span></p>\n\n<pre>\n<code class=\"language-java\">public static void main(String[] args) {\n        SpringApplication.run(BlogApplication.class, args);\n    }\n@Bean\n    public TomcatServletWebServerFactory servletContainer() {\n        TomcatServletWebServerFactory tomcat = new TomcatServletWebServerFactory() {\n            @Override\n            protected void postProcessContext(Context context) {\n                SecurityConstraint constraint = new SecurityConstraint();\n                constraint.setUserConstraint(\"CONFIDENTIAL\");\n                SecurityCollection collection = new SecurityCollection();\n                collection.addPattern(\"/*\");\n                constraint.addCollection(collection);\n                context.addConstraint(constraint);\n            }\n        };\n        tomcat.addAdditionalTomcatConnectors(httpConnector());\n        return tomcat;\n    }\n\n    @Bean\n    public Connector httpConnector() {\n        Connector connector = new Connector(\"org.apache.coyote.http11.Http11NioProtocol\");\n        connector.setScheme(\"http\");\n        //Connector监听的http的端口号\n        connector.setPort(80);\n        connector.setSecure(false);\n        //监听到http的端口号后转向到的https的端口号\n        connector.setRedirectPort(443);\n        return connector;\n    }</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">7.启动项目，如果是本地调试，由于域名是localhost与证书不一致，浏览器会自动提示证书存在问题，不建议访问，发布域名对应服务器后即可消除警告。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"161\" src=\"/images/1580640352086.jpg\" width=\"370\" />\n<figcaption>图7 部署成功效果图，链接为https开头</figcaption>\n</figure>\n</div>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"293\" src=\"/images/1580640438493.jpg\" width=\"361\" />\n<figcaption>图8 部署本地（域名不一致）</figcaption>\n</figure>\n</div>\n\n<p>&nbsp;</p>','2020-02-02 18:45:10','2020-02-02 18:47:56'),(55,63,'<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;很久之前就一直想拥有自己的博客网站，历经数月，如今终于正式上线，从后端到前端一直到部署，学习了很多东西，这是自己的第一个SpringBoot项目，需要长期自行维护，为了纪念这很有意义的时刻，写下了这篇Hello world!</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 对于后端开发，耗费的时间占比还好，收获颇多：软件开发体系的理解，前后端分离设计模式，良好的编程习惯（推荐阅读阿里巴巴开发手册），数据表设计（<span style=\"color:#e74c3c\">十分重要，必须要多花时间进行确定，不然开发过程中很容易&ldquo;牵一发而动全身&rdquo;，因为需要某个属性导致代码大量修改</span>），同时也get到了大量的高效率工具包，比如hutool，pageHelper,mybatis-generator,justAuth等等，这些工具包大大提升后端开发的效率，只可惜在开发前期没能早点集齐这些工具包。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"357\" src=\"/images/1580821858365.jpg\" width=\"661\" />\n<figcaption>图1 IDEA project截图</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 重点就是前端开发，博客后台管理部分其实还好，我使用了AceAdmin管理模板，最大的问题就是文章编辑器的实现，还好有专门的套件，我采用的是CKEditor4，实现写文章就和写word文档一样方便（思路：CKEditor将富文本数据转化为对应的html字符串，然后将html字符串存入数据库，字段设置为text，展示时，直接将html字符串渲染出来即可）。后台管理部分其他功能实现就比较简单了，对于后台管理参数（例如公告，最后后台登录时间），可以建一个属性表，里面主要字段有name和value,用于存放后台管理参数；表格部分使用的是dataTable（和后台的PageHelper搭配使用，效果杠杠的）。前台展示部分是最耗费精力的地方，一开始寻找了blog模板，模板最大问题就是定制会很麻烦（有些时候原模板会限制自己的发挥），后来实在是走不下去了，于是选择自己从&ldquo;零&rdquo;开始设计前台展示页面，最终选定了LayUi,在制作过程中，参考了大量的博客设计，最终定型了现在样子。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"309\" src=\"/images/1580821989833.jpg\" width=\"663\" />\n<figcaption>图2 后台发布编辑页面</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; </span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"315\" src=\"/images/1580824929724.jpg\" width=\"674\" />\n<figcaption>图3 一开始选定的前台模板</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;部署购买了腾讯云服务器（学生价10元一月的配置），申请了SSL证书（个人免费），阿里云购买的域名（60元三年），项目使用maven打包，最后发布到服务器上。</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 结语：博客上线只是开始，而不是结束，不断的学习和思考才是最终目的。</span></span></p>\n\n<p>&nbsp;</p>','2020-02-04 21:04:24','2020-02-15 18:15:09'),(56,64,'<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\">一&nbsp; 、原理讲解：如果想要给B发送邮件，肯定需要发件邮箱A,我们需要登录邮箱A,开放第三方登录授权，获取授权码，然后就可以利用Java代码实现登录邮箱A并且发送邮件给B,使用hutool简化java发送邮件的步骤（hutool发送邮件的高级操作请参考hutool官方文档）。</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">二、示例步骤：</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 1.首先去邮箱中授权第三方登录邮件客户端（不同邮箱设置不同，自行百度，图示为网易邮箱）</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"260\" src=\"/images/1580989480599.jpg\" width=\"467\" />\n<figcaption>标题</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 2.在项目中添加必要依赖</span></span></p>\n\n<pre>\n<code class=\"language-java\">&lt;!--hutool--&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;cn.hutool&lt;/groupId&gt;\n            &lt;artifactId&gt;hutool-all&lt;/artifactId&gt;\n            &lt;version&gt;5.0.3&lt;/version&gt;\n        &lt;/dependency&gt;\n&lt;!--mail--&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;javax.mail&lt;/groupId&gt;\n            &lt;artifactId&gt;mail&lt;/artifactId&gt;\n            &lt;version&gt;1.4.7&lt;/version&gt;\n        &lt;/dependency&gt;</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 3.在配置文件中添加以下属性（host为邮件请求服务器，以网易邮箱为例：smtp.163.com ;pass为授权码，第一步开启第三方登录时会要求设置该码 ；from为发件人邮箱地址）</span></span></p>\n\n<pre>\n<code class=\"language-xml\">#邮件参数设置\nmail.host=\nmail.pass=\nmail.from=</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;4.功能函数实现如下</span></span></p>\n\n<pre>\n<code class=\"language-java\">@Value(\"${mail.host}\")\nString mailHost;\n@Value(\"${mail.pass}\")\nString mailPass;\n@Value(\"${mail.from}\")\nString mailFrom;\npublic void informByMail(String address, String subject,String content) {\n        MailAccount account=new MailAccount();\n        account.setHost(mailHost);\n        account.setFrom(mailFrom);\n        account.setPass(mailPass);\n        account.setAuth(true);\n        //使用SSL安全连接\n        account.setSslEnable(true);\n        MailUtil.send(account, address, subject, content, false);\n    }</code></pre>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; <span style=\"color:#e74c3c\">5.在部署项目时如果网站使用了ssl安全协议（https），必须要使用SSL安全连接，否则无法成功发送邮件（亲身经历的问题）。</span></span></span></p>','2020-02-06 19:57:26','2020-02-13 16:46:27'),(58,66,'<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\">本文用于记录FastJson的使用说明：</span></span></p>\n\n<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\">一、对象序列化（bean to jsonString）</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">1.序列化时，忽略bean的指定属性：在class对应属性上添加如下注解：</span></span></p>\n\n<pre>\n<code class=\"language-java\"> @JSONField(serialize = false)</code></pre>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">2.Date属性自定义序列化样式：在class对应属性上添加如下注解：</span></span></p>\n\n<pre>\n<code class=\"language-java\">@JSONField(format = \"yyyy年MM月dd日 HH:mm:ss\")</code></pre>\n\n<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\">二、对象反序列化（jsonString to bean）</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">1.json数组转换为List,代码如下：（jsonString 为json字符串，Object为目标反序列化对象类）</span></span></p>\n\n<pre>\n<code class=\"language-java\">List&lt;Object&gt; objectList= JSONObject.parseArray(jsonString,Object.class);</code></pre>\n\n<p>&nbsp;</p>','2020-02-12 18:12:16','2020-02-13 16:46:13'),(59,67,'<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">一、用途：用于核实关键字是否<span style=\"color:#e74c3c\">可能</span>存在</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">二、原理：布隆过滤器（bloomfilter）由两个部分组成：hash函数组以及二进制布隆向量，布隆向量用于标记关键字是否存在，hash函数组则用来确认关键字对应的向量坐标。这里为了方便理解，我们假设一个布隆向量长度为8bit，hash函数组含有三个hash函数，分别为hash1()、hash2()以及hash3()。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"91\" src=\"/images/1581739538954.jpg\" width=\"328\" />\n<figcaption>图1 初始状态的布隆向量</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">初始状态为空的二进制布隆向量为8个bit均为0的向量，我们假设先往这个过滤器中添加关键字&ldquo;zhou&rdquo;,首先需要对这个关键字进行hash操作，由于hash函数的特性，我们可以得到唯一的数字（0~7），我们假设hash1、2、3分别得到的数字为1 3 4,然后将布隆向量中对应位置的bit置为1，表示&ldquo;zhou&rdquo;存储于布隆过滤器中。如图所示：</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"195\" src=\"/images/1581739591672.jpg\" width=\"323\" />\n<figcaption>图2 存储&ldquo;zhou&rdquo;关键字后的布隆向量</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">如果我们需要验证&ldquo;zhou&rdquo;关键字是否存在，那么我们只需要对其进行hash操作，得到不同的数字，然后获取布隆向量上对应bit的值，如果均为1，那么就说明&ldquo;zhou&rdquo;<span style=\"color:#e74c3c\">可能存在（后面解释为什么是可能存在）</span>。现在我们再添加关键字&ldquo;jian&rdquo;，重复以上操作，我们假设hash结果分别为 2 3 5，然后将布隆向量中对应位置的bit置为1，由于3下标的bit已经置为1，所以无需操作，结果如图所示：</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"192\" src=\"/images/1581739666547.jpg\" width=\"326\" />\n<figcaption>图3 存储&ldquo;jian&rdquo;关键字后的布隆向量</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">查询&ldquo;jian&rdquo;是否存在时，与查询&ldquo;zhou&rdquo;是否存在同理，只要确认2 3 5bit均为1则可以判定&ldquo;jian&rdquo;<span style=\"color:#e74c3c\">可能存在（如果任一对应的bit为0，则可判定不存在）</span>。<span style=\"color:#2980b9\">因为布隆向量长度是固定的，随着存储关键字的增多，再加上hash函数的冲突特性，就会导致布隆向量所有的bit全部置为1，而此后，无论你验证什么数据，对应的bit的值均为1，就会误判该关键字存在于布隆过滤器之中，事实上并不存在，称之为：</span><span style=\"color:#e74c3c\">误报</span></span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><span style=\"color:#2980b9\">如图所示，关键字&ldquo;guo&rdquo;并不存在于布隆过滤器之中，但是布隆过滤器仍然会返回true：</span></span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"195\" src=\"/images/1581739764296.jpg\" width=\"317\" />\n<figcaption>图4 布隆向量满时，一定会误报</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">如果想要删除过滤器中指定的关键字，显然很容易发现很可能产生误删，因为多个关键字可能会共用一个bit，解决办法就是对每一个bit进行计数，当计数为0时，即可将对应bit置0；我们以图三为例，我们要删除关键字&ldquo;jian&rdquo;，如图所示：</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"142\" src=\"/images/1581739856999.jpg\" width=\"339\" />\n<figcaption>图5 删除&ldquo;jian&rdquo;关键字之前的状态</figcaption>\n</figure>\n</div>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"167\" src=\"/images/1581739870405.jpg\" width=\"345\" />\n<figcaption>图6 删除&ldquo;jian&rdquo;关键字的状态</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">三、性能分析：</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;时间：由于采用了hash函数，复杂度很明显是恒定的，为O（1）。</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;空间：长度固定，采用了hash压缩，空间消耗很低。</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;正确性：对于指定大小布隆向量的布隆过滤器，随着存储数据的增多，误报率也就会快速增加；对于不同大小布隆向量的布隆过滤器，布隆向量越大，误报率越低。误报率公式如下：</span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">m为布隆向量长度，k为hash函数的个数，n为已插入的元素个数。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"116\" src=\"/images/1582603223600.jpg\" width=\"265\" />\n<figcaption>图7 布隆过滤器误报率</figcaption>\n</figure>\n</div>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"579\" src=\"/images/1582635321038.jpg\" width=\"644\" />\n<figcaption>图8 误报率对照表</figcaption>\n</figure>\n</div>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">四、应用：</span></span><br />\n<span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">&nbsp;&nbsp;缓存穿透：我们经常会把一部分数据放在Redis等缓存，比如用户详情。这样有查询请求进来，我们可以根据用户Id直接去缓存中取数据，而不用读取数据库，这是提升性能最简单，最普遍，也是最有效的做法。一般的查询请求流程是这样的：先查缓存，有缓存的话直接返回，如果缓存中没有，再去数据库查询，然后再把数据库取出来的数据放入缓存，由于布隆过滤器拥有极小的时空开销，可以很大程度上减少对数据库的无用请求（存在误报，但是这是妥协的代价）。</span></span></p>','2020-02-15 11:31:34','2020-02-25 20:55:58'),(60,68,'<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">一、简介：图一是一个文档的结构，文档由许多的单词组成。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"244\" src=\"/images/1582604422647.jpg\" width=\"223\" />\n<figcaption>图一：文档结构</figcaption>\n</figure>\n</div>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;假设我们有3个文档，为了方便管理，我们需要对其建立如图二所示的文档集合。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"208\" src=\"/images/1582604456694.jpg\" width=\"375\" />\n<figcaption>图二：示例文档集合</figcaption>\n</figure>\n</div>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp;&nbsp;当我们需要查询所有包含关键词word2的文档时，我们需要把<span style=\"color:#e74c3c\">三个文档都查一遍</span>如图三所示，并把包含有word2关键此词的文档file1和file2作为检索结果返回。这样的检索方式就叫做<span style=\"color:#e74c3c\">正排索引 </span>。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"212\" src=\"/images/1582604677225.jpg\" width=\"374\" />\n<figcaption>图三：word2关键词的检索结果</figcaption>\n</figure>\n</div>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">&nbsp; 很明显，这样的检索方式有着很大的问题，所期望的是获取所有含有word2的文档，但是却要对<span style=\"color:#e74c3c\">每个文档</span>进行<span style=\"color:#e74c3c\">完全</span>检索，于是将文档与单词的关系逆转过来，如图四所示，这样就可以直接通过检索关键词的方式直接获取哪些文档包含该关键词，节省了大量的检索时间。</span></span></p>\n\n<div style=\"text-align:center\">\n<figure class=\"image\" style=\"display:inline-block\"><img alt=\"\" height=\"353\" src=\"/images/1582634063710.jpg\" width=\"290\" />\n<figcaption>图四：调整后的索引结构</figcaption>\n</figure>\n</div>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\">二、概念介绍：</span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><span style=\"color:#e74c3c\">&nbsp;&nbsp;1.文档：以文本形式存储的文件（一个网页，一封邮件等等），里面包含多个关键词信息。</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><span style=\"color:#e74c3c\">&nbsp;&nbsp;2.文档集合：由多个文档组成的集合称之为文档集合。</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><span style=\"color:#e74c3c\">&nbsp; 3.文档编号（id）：管理者会对文档集合进行编号，类似于数据表的主键，方便管理。</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><span style=\"color:#e74c3c\">&nbsp; 4.单词词典：根据文档集合整理出来的单词集合，一般都会在单词字符串后添加文档的文件地址从而实现关键词对文档的映射，即：（单词，文件地址）</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><span style=\"color:#e74c3c\">&nbsp; 5.倒排列表：倒排列表记载了出现过某个单词的所有文档的文档列表及单词在该文档中出现的位置信息，每条记录称为一个倒排项。根据倒排列表，即可获知哪些文档包含某个单词。</span></span></span></p>\n\n<p style=\"text-align:justify\"><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:18px\"><span style=\"color:#e74c3c\">&nbsp; 6.倒排文件：倒排列表存储的物理形式，即倒排列表存储形式。</span></span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>','2020-02-25 12:11:22','2020-03-01 21:42:55'),(61,69,'<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS,cursive\">本文用于记录Matlab作实验图的常用指令。<span style=\"color:#e74c3c\">（Matlab版本为2017b x64）</span></span></span></p>\n\n<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"font-size:20px\">一、坐标轴标签</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">1.标签字体大小设置：label内添加属性：</span><span style=\"font-family:Microsoft YaHei\"><span style=\"color:#e74c3c\">&#39;FontSize&#39;</span>&nbsp;</span><span style=\"font-family:Comic Sans MS,cursive\">例：</span><span style=\"font-family:Microsoft YaHei\">xlabel(&#39;testXlabel&#39;,&#39;FontSize&#39;,14)</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">2.标签文字斜体：</span><span style=\"color:#e74c3c\"><span style=\"font-family:Microsoft YaHei\">\\it</span></span><span style=\"color:#c0392b\"><span style=\"font-family:Microsoft YaHei\">&nbsp;</span></span><span style=\"font-family:Comic Sans MS,cursive\">例：</span><span style=\"font-family:Microsoft YaHei\">xlabel(&#39;\\it&mu;&#39;)</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">3.标签文字下标：单个字符：</span><span style=\"font-family:Microsoft YaHei\"><span style=\"color:#e74c3c\">_</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#e74c3c\"> </span>多个字符：<span style=\"color:#e74c3c\">&nbsp;</span></span><span style=\"font-family:Microsoft YaHei\"><span style=\"color:#e74c3c\">_{}</span></span><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#e74c3c\">&nbsp;</span>例：</span><span style=\"font-family:Microsoft YaHei\">_&mu; ; _{text}</span></span></p>\n\n<p><span style=\"font-size:20px\"><span style=\"font-family:Comic Sans MS, cursive\">二、坐标轴标注</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS, cursive\">1.标注范围：</span><span style=\"color:#e74c3c\"><span style=\"font-family:Microsoft YaHei\">xlim([,]),ylim([,]) </span></span><span style=\"font-family:Comic Sans MS,cursive\">例：</span><span style=\"font-family:Microsoft YaHei\">xlim([0,512]);ylim([0,512]);</span><span style=\"font-family:Comic Sans MS,cursive\">限制x轴坐标数值范围0-512,限制x轴坐标数值范围0-512</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS, cursive\">2.标注数值刻度：</span><span style=\"font-family:Microsoft YaHei\"><span style=\"color:#e74c3c\">set(gca,&lsquo;XTick&rsquo;,:/:)&nbsp;</span></span><span style=\"font-family:Comic Sans MS,cursive\">例：</span><span style=\"font-family:Microsoft YaHei\">set(gca,&lsquo;XTick&rsquo;,0:510/4:512);</span><span style=\"font-family:Comic Sans MS,cursive\">设定x轴坐标刻度，0：512是数值范围，512/4表示分为4个刻度{128,256,384,512}</span></span></p>\n\n<p><span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">3.标注自定义刻度：</span><span style=\"color:#e74c3c\"><span style=\"font-family:Microsoft YaHei\">set(gca,&lsquo;XTickLabel&rsquo;,{})</span></span><span style=\"font-family:Comic Sans MS,cursive\">例：</span><span style=\"font-family:Microsoft YaHei\">set(gca,&lsquo;XTickLabel&rsquo;,{&rsquo;-&pi;&rsquo; &lsquo;-&pi;/2&rsquo; &lsquo;0&rsquo; &lsquo;&pi;/2&rsquo; &lsquo;&pi;&rsquo;})</span></span>; <span style=\"font-size:18px\"><span style=\"font-family:Comic Sans MS,cursive\">设置x轴坐标标注，对应5个刻度{</span><span style=\"font-family:Microsoft YaHei\">&rsquo;-&pi;&rsquo; &lsquo;-&pi;/2&rsquo; &lsquo;0&rsquo; &lsquo;&pi;/2&rsquo; &lsquo;&pi;&rsquo;</span><span style=\"font-family:Comic Sans MS,cursive\">}</span></span></p>','2020-03-28 13:01:03','2020-03-28 14:19:26');
/*!40000 ALTER TABLE `tbl_article_content` ENABLE KEYS */;
